import React, {memo} from 'react';
import styled from 'styled-components';

const BannerContentContainer = styled.div`
    width:100%;
    margin-top:60px;
    text-align: center;

    .supContentWrap{
        width:100%;
        height:480px;
        background-color: #f9f9f9;

        .supContentInner{
            max-width: 1200px;
            margin:0 auto;

            .supConTitle{
                font-size:30px;
                font-weight: 700;
            }

            .supContxt{
                font-size:16px;
                margin-top:10px;
                color:#959595;
            }
        }
    }
`;

const BannerContent = memo(() => {
    return (
        <BannerContentContainer>
            <div className='supContentWrap'>
                <div className='supContentInner'>
                    <h1 className='supConTitle'>국비교육의 모든 것!</h1>
                    <p className='supContxt'>국비교육에 대한 모든 정보를 한 눈에 확인하세요.</p>
                </div>
            </div>
        </BannerContentContainer>
    );
});

export default BannerContent;
